import React from "react";

function Product({ item }, props) {
  const images1 = item.map(({ images1 }) => images1);
  const details = images1.map(({ front }) => front);

  return (
    <div>
      {details.map(() => {
        return (
          <a href={`/shop/${item.category}/${item.id}`}>
            <img src={details} alt={item.item_name} />
          </a>
        );
      })}
    </div>
  );
}
export default Product;
